-- ----------------------------
-- Table structure for sys_user
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '用户名',
  `pass_word` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '密码',
  `company` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '所属公司',
  `user_status` int(1) NULL DEFAULT NULL COMMENT '用户状态：0(初始)正常 1禁用(普通用户上传失败使用) -1删除(被删除审核员)  -2：导入值',
  `upload_amount` int(11) NULL DEFAULT NULL COMMENT '上传篇数：默认20',
  `upload_residue` int(11) NULL DEFAULT NULL COMMENT '剩余篇数，审核成功剩余篇数-1，失败+1默认20',
  `upload_fail` int(11) NULL DEFAULT 0 COMMENT '上传失败论文数量，包括解析、检测、审核、支付等失败',
  `phone_number` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '手机',
  `e_mail` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '邮箱',
  `create_time` timestamp(0) NULL DEFAULT CURRENT_TIMESTAMP(0) COMMENT '创建时间',
  `role_id` int(11) NULL DEFAULT NULL COMMENT '用户角色',
  `doc_ids` int(11) NULL DEFAULT NULL COMMENT '审核员角色专属',
  `forbidden_time` timestamp(0) NULL DEFAULT NULL COMMENT '用户禁用时间。与用户状态1关联',
  `cnki_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT 'cnki平台登录返回用户名',
  `student_num` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '学号',
  `college` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '学院',
  `major` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '专业',
  `degree` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '学位类型',
  `ident_photo` mediumblob NULL COMMENT '个人证件照',
  `real_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '姓名',
  `remarks` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '备注信息',
  `sign` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '加密标签',
  `pic_path` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '图片在ftp内的路径',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `userName`(`user_name`) USING BTREE,
  UNIQUE INDEX `phoneNumber`(`phone_number`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 177 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

